    "**Description of the Models**\n",
    "\n",
    "For this project, I decided to produce a **logistic regression model with no regularization**, a **logistic regresssion model with ridge penalty**, and a **logistic regression with lasso penalty**. Below are further details about each model, as well as the specific settings used for model fitting. \n",
    "\n",
    "***Model 1: Logistic Regression with No Regularization***\n",
    "\n",
    "Logistic regression is a broadly used classification algorithm that applies a linear model to \"predict the probability of a binary outcome\" (RITHP, 2023). In this case, the binary outcome to be predicted is whether or not a tweet is referring to an actual disaster (i.e., \"Disaster\" or \"Otherwise\"). For this model, I used cross-validation to calculate the log loss, a evaluation metric for binary classification models that measures performance \"by quantifying the difference between predicted probablities and actual values\" (Setia, 2023).\n",
    "\n",
    "***Model 2: Logistic Regression with Ridge Penalty***\n",
    "\n",
    "Ridge regression is a convenient problem-solving option when there is \"less than 100,000 samples or when there are more parameters than samples\" (Maklin, 2018). As the data for this project falls under the former criterion, I thought it would be worthwhile to create this type of model. In addition, ridge (and lasso) penalties are used to \"prevent overfitting in regression models by adding regularization terms to the cost function\" (Jain, 2023). This stimulates the development of simpler models characterized by fewer predictors, enhancing their overall generalizability. For this model, I used a hyperparameter tuning grid for ridge penalty (lamba) with alpha being zero.\n",
    "\n",
    "* **Data Visualizations**"
