    "***Model 3: Logistic Regression with Lasso Penalty***\n",
    "\n",
    "Lasso regression is a regularization technique (Jain, 2023). It is often preferred over other regression techniques to enhance prediction accuracy. This model incorporates a technique called *shrinkage*, which involves pulling data values closer to a central point (typically the mean). The lasso procedure specifically promotes the creation of simple and sparse models, characterized by having fewer parameters. Similar to Model 2, I used a hyperparameter tuning grid for lasso penalty (lambda). However, this time, alpha was set to one.\n",
    "\n",
